        public static List<string> ExtractUrlsFromDivs(string[] divs)
        {
            List<string> urls = new List<string>();
            string pattern = @"www\.[^\s&#;]+"; // Match www. followed by non-space characters

            foreach (string div in divs)
            {
                MatchCollection matches = Regex.Matches(div, pattern);

                foreach (Match match in matches)
                {
                    urls.Add(match.Value);
                }
            }

            return urls;
        }

        public static string GetSubstringAtPosition(string input, int position)
        {
            // Get the maximum length of the substring
            int maxLength = Math.Min(input.Length - position, 500); // You can adjust the maximum length as needed
            return input.Substring(position, maxLength);
        }
    
   


