            foreach (Match positionMatch in positionMatches)
            {
                positions.Add(positionMatch.Index);
            }

            // Extract URLs from positions
            List<string> urls = new List<string>();
            foreach (int pos in positions)
            {
                string substring = GetSubstringAtPosition(htmlContent, pos);
                MatchCollection urlMatches = Regex.Matches(substring, urlPattern);
                foreach (Match urlMatch in urlMatches)
                {
                    urls.Add(urlMatch.Value);
